query GetDashboardByName($name: String!) {
  getDashboardByName(name: $name) {
    name
    type
    data {
      headline {
        heniMentions
        heniNftMentions
        heniProfileMentions
        heniShowsMentions
        marketSales
        heniScore
        datePeriod
        __typename
      }
      timeseries {
        date
        heniMentions
        heniNftMentions
        heniProfileMentions
        heniShowsMentions
        marketSales
        heniScore
        __typename
      }
      __typename
    }
    __typename
  }
}
